// import Vue from 'vue'

import Router from 'vue-router'

import Login from '../components/Login'

Vue.use(Router)

export default new Router({

  routes: [

    {

      path: '/Login',

      name: 'Login',

      component: Login

    },

    {

      path:"/Login",

      component:() => import('@/components/Login.vue')

    }

  ],

  mode: "history"//干掉地址栏里边的#号键

})
